using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using API.Models;
using API.ViewModels;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using Models;
using Models.Entities;

namespace Tests.Controllers
{
    [TestClass]
    public class FileControllerTest : BaseControllerTest
    {
        private User _user;

        public FileControllerTest()
        {
            _user = _context.Users.First(u => u.Role == Role.PortalAdmin);
        }

        [TestMethod]
        public void Get_Ok_Test()
        {
            var file = _context.Files.First();
            var url = $"api/file/{file.Code}";
            var result = HttpGet<FileViewModelGet>(url);
            Assert.AreEqual(file.Id, result.Id);
        }

        //[TestMethod] Часто может не быть файлов и методы не датут ожидаемого результата
        public void GetData_Ok_Test()
        {
            var file = _context.Files.First();
            var url = $"api/file/data/{file.Code}";
            var result = HttpGet<byte[]>(url);
            Assert.IsTrue(result!=null && result.Length>0);
        }

        //[TestMethod] Часто может не быть файлов и методы не датут ожидаемого результата
        public void GetThumb_Ok_Test()
        {
            var file = _context.Files.First();
            var url = $"api/file/data/{file.Code}?thumb=true";
            var result = HttpGet<byte[]>(url);
            Assert.IsTrue(result != null && result.Length > 0);
        }

        [TestMethod]
        public void Post_Ok_Test()
        {
            string rndString = Guid.NewGuid().ToString();
            string base64data = "";
            var viewModel = new FileViewModelPost
            {
                Name = rndString,
                FormId = rndString,
                Extension = "png",
                Data = base64data
            };
            var url = $"api/file";
            var result = HttpPost<FileViewModelGet>(url, viewModel, _user.AuthToken);
            Assert.AreEqual(rndString, result.Name);
        }

        [TestMethod]
        public void PostToExistObject_Ok_Test()
        {
            var comment = _context.Comments.First();
            string rndString = Guid.NewGuid().ToString();
            string base64data = "";
            var viewModel = new FileToExistsObjectViewModelPost()
            {
                Name = rndString,
                Extension = "png",
                Data = base64data,
                LinkedObjectType = LinkedObjectType.Comment,
                LinkedObjectId = comment.Id
            };
            var url = $"api/file/to-exists-object";
            var result = HttpPost<FileViewModelGet>(url, viewModel, _user.AuthToken);
            Assert.AreEqual(rndString, result.Name);
        }

        [TestMethod]
        public void Delete_Ok_Test()
        {
            var file = _context.Files.ToList().Last();
            var url = $"api/file/{file.Id}";
            HttpDelete<string>(url, _user.AuthToken);

            using (var cntxt = new LrdrContext())
            {
                Assert.IsNull(cntxt.Files.FirstOrDefault(f => f.Id == file.Id));
            }
        }
    }
}
